let i = 0;

export class About extends Component {
  render() {
    let { title, desc } = this.props;

    return (
      <div
        className="Container"
        style={{
          alignSelf: "1000px",
          width: "1000px",
          height: "100px",
          alignContent: "center",
        }}
      >
        News each components {title} {desc}{" "}
        {
          (imgurl =
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ2dVbLMzlaeJnL5C6RpZ8HLRECJhH6ILEGKg&s")
        }
        {(i = i + 1)}
      </div>
    );
  }
}

export default About;
